import React from 'react';
import '../styles/big-image.css';

function BigImage() {
    return (
        <div className="big-image-wrapper">
            <section className="big-image" id="home">
                <div className="big-image-content" data-aos="fade-right" data-aos-duration="1500">
                    <h2>Hương Việt Tinh</h2>
                    <p>Đẳng cấp lên ngôi, niềm vui mong chờ, giây phút mộng mơ</p>
                    <button className="btn">
                        <a href="../Booking/booking.html" target="_blank" rel="noopener noreferrer">
                            Đặt bàn
                        </a>
                    </button>
                </div>
            </section>
        </div>
    );
}

export default BigImage;
